120		(919) 560-3908	all	all	Burton Magnet is the only IB Magnet Elementary school in Durham. 	Dr. Kimberly Ferrell	Dr. Kimberly Ferrell (since 2015)\r\n\r\nDr. Ferrell began her career in education in 1992 as a teacher Bunn Elementary School in Franklin County, NC. She taught 2nd and 3rd grades, and also served as the Academically/ Intellectually Gifted Resource teacher for K-5. In 2002 she became the Assistant Principal at Royal Elementary School and remained there until 2004. In 2004, Dr. Ferrell received her first position as principal at Laurel Mill Elementary School. In 2008, Dr. Ferrell opened Long Mill Elementary School as principal until 2014. She became principal at Burton Magnet Elementary School in 2014.   \r\n\r\nDr. Ferrell began her education at Fayetteville State University from 1986 to 1990 and received a B.S. in Early Childhood Education K-6. From 1999 to 2002, she earned her Master of School Administration at North Carolina State University. She received her Superintendent License in 2011 and a Doctorate in Educational Leadership in 2013 from North Carolina State University. \r\n\r\nDr. Ferrell has had many leadership experiences that has helped to develop her leadership qualities. In 1999, she was selected to represent Franklin County School in the Growing Future Leaders program. In 2006, she presented at the National Staff Development Conference on the impact of PLCs and Whole Faculty Study Groups. In 2007, Dr. Ferrell completed the North Carolina Principal Executive Program of Quality Teaching and Learning Leadership for experienced principals. In 2010, she was selected to be a Northeastern Leadership Academy Mentor for North Carolina State University where she mentored several new school administrators. In 2014, she completed Magnet Level 1 Training in New Orleans, Louisiana. In 2015, she completed Magnet Level 2 Training in Miami, Florida. \r\n\r\nDr. Ferrell has received many honors in her career. In 1999 she was Teacher of the Year for Bunn Elementary in Franklin County, NC. In 2008, she was Franklin County Principal of the Year. In 2011, she was inducted in the Kappa Delta Phi Honor Society at North Carolina State University. In 2012, she represented Franklin County on the Central Carolina Regional Education Principal Council. \r\n\r\nDr. Ferrell's greatest honor is being a Wake County foster parent. Her greatest joy is raising her 17 year old daughter, Marissa Ferrell, who attends Enloe GT/IB Magnet High School in Raleigh, NC. 	2014	General Information - from DPS\r\nWe are committed to ensuring that every student has access to the general curriculum and an opportunity to learn that is equal to that of non-disabled students. Specially designed, research-based instruction is provided in the least restrictive environment to promote student development. We are dedicated to building authentic parent and community relationships!\r\n\r\nMore Information\r\nFor more information on Exceptional Children Program, policies, and procedures, please visit the Exceptional Children (EC) Services at DPS at durham.schoolwires.net//site/Default.aspx?PageID=169. Any additional questions should be directed to Gloria Cole or Franca Emezie, EC Resource for Burton Magnet. See the "Staff Directory" page for details.  	General Information - from DPS\r\nThe Academically and Intellectually Gifted Program will ensure that all students achieve at their highest potential regardless of race, gender, or socio-economic status. Each student will make continuous progress and be at or above grade level. \r\n\r\nMore Information\r\nFor more information on AIG Program guidelines, policies, and procedures, please visit the Advanced & Intellectually Gifted (AIG) Programs page at www.dpsnc.net/Page/167. Any additional questions should be directed to Desiree Anderson, AIG Facilitator for Burton Magnet. See the "Staff Directory" page for details.  	179	2016-06-29 00:33:45.398001+00	2016-07-28 02:18:32.038046+00	5	-1	elementary	The stakeholders 